INSERT INTO `page__page_translations` VALUES (1,1,'en','Home page','home',1,'<p>V pripravi spletni portal za ekoloske izdelke.</p>\r\n\r\n<p>Izdelki in storitve ki imajo celostne in ekoloske - ..</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n','Ekoloski izdelki','','','',NULL,'website','2017-05-22 19:13:17','2017-05-22 19:27:47'),(2,2,'en','About','about',1,'<p>Spletna stran je v fazi raziskave trga, in zascita domene ekoloski-izdelki.si</p>\r\n\r\n<p>Osnavna ideja:<br />\r\n<br />\r\nHrana je ekoloska ce med pridelovalcem in potrosnikom ni posrednika.<br />\r\n<br />\r\nImas moznost da sam obisces ekolosko kmetijo ce to omogoca.</p>\r\n\r\n<p>Potrebujes</p>\r\n\r\n<ul>\r\n	<li>Informacijski sistem : vmesnik z informacijami za razlicne uporabnikeske vloge</li>\r\n	<li>Rezervacija: vmesnik za uporabo sodobnih tehnologij : sms, mms, push notifications, email, fax</li>\r\n</ul>\r\n\r\n<p>Ali hrano kupis na spletu, oz. podjetju ki ti ga lahko iz najblizje okolice najbolj ekolosko dostavi.</p>\r\n\r\n<ul>\r\n	<li>Uporabniska izkusnja : Informiranost o izdelku : ocene, komentarji...</li>\r\n	<li>Elektricna vozila</li>\r\n	<li>Ekolosko pakiranje : brez plastike</li>\r\n	<li>Produkti sortirani na mapi po oddaljenosti : minimiramo energijo potrebno za dostavo in svezino</li>\r\n	<li>Moznost tedenskega nakupa : majn km za prevoz</li>\r\n</ul>\r\n','','','','',NULL,'website','2017-05-26 07:17:16','2017-05-26 09:12:55'),(3,2,'sl','O storitvi','o-storitvi',1,'<blockquote>\r\n<p>Be the change you want to see in the world.<br />\r\nMahatma Gandhi</p>\r\n</blockquote>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Spletna stran je v fazi raziskave trga, in za za&scaron;ito domene ekoloski-izdelki.si</p>\r\n\r\n<h2>Vizija</h2>\r\n\r\n<p>Hrana je ekolo&scaron;ka e med pridelovalcem in potrosnikom ni posrednika.</p>\r\n\r\n<p><br />\r\n<br />\r\nImas moznost da sam obisces ekolosko kmetijo ce to omogoca.</p>\r\n\r\n<p>Potrebujes</p>\r\n\r\n<ul>\r\n	<li>Informacijski sistem : vmesnik z informacijami za razlicne uporabnikeske vloge</li>\r\n	<li>Rezervacija: vmesnik za uporabo sodobnih tehnologij : sms, mms, push notifications, email, fax</li>\r\n</ul>\r\n\r\n<p>Ali hrano kupis na spletu, oz. podjetju ki ti ga lahko iz najblizje okolice najbolj ekolosko dostavi.</p>\r\n\r\n<ul>\r\n	<li>Uporabniska izkusnja : Informiranost o izdelku : ocene, komentarji...</li>\r\n	<li>Elektricna vozila</li>\r\n	<li>Ekolosko pakiranje : brez plastike</li>\r\n	<li>Produkti sortirani na mapi po oddaljenosti : minimiramo energijo potrebno za dostavo in svezino</li>\r\n	<li>Moznost tedenskega nakupa : majn km za prevoz</li>\r\n</ul>\r\n','','','','',NULL,'website','2017-05-26 07:17:16','2017-05-26 09:32:39'),(4,1,'sl','Domov','domov',1,'<p>V pripravi spletni portal za ekoloske izdelke.</p>\r\n\r\n<p>Izdelki in storitve ki imajo celostne in ekoloske - ..</p>\r\n','','','','',NULL,'website','2017-05-26 09:28:58','2017-05-26 09:28:58');
